import './App.css';
import Navigation from "./Components/Navigation/Navigation";
import Logo from "./Components/Logo/Logo";
import ImageLinkForm from "./Components/ImageLinkForm/ImageLinkForm";
import Rank from "./Components/Rank/Rank";
import "particles-bg";


const particlesStyle = {
  position: "absolute", 
  zIndex: -1, 
  top: 0, 
  left: 0,
  width: "100%",
  height: "100%"
};

function App() {
  return (
    <div className="App">
    <particles-bg
        type="circle"
        color="#ff0000"
        num={200}
        bg={true}
        style={particlesStyle}  // Apply the extracted styles here
      ></particles-bg>
    <Navigation/>
    <Logo/>
    <Rank/>
    <ImageLinkForm/>
    </div>
  );
}

export default App;
